window.bookSummaryJSON = "<p><i>USA Today</i> best-selling author Taylor Aston White brings you this newly addictive dark paranormal romance.</p> <p>He despises her...almost as much as his beast craves her.</p> <p>Kyra’s seen and survived the worst things imaginable, all because of the magic she was born with. Trapped by her secret, she has no choice but to serve Councilman Gallagher or risk everything she has tried so hard to build. Because despite black magic being banned, her very survival depends on it.</p> <p>Xander’s hate for black witches was notorious, but nothing frustrated him more than the one witch who brings trouble with a capital T. With dark amber eyes and a controlled strength that fascinated his beast—the monster he’s cursed to share a soul with—Xander will do anything to push her away.</p> <p>So when he’s forced into protecting her, he must put aside his prejudice and ignore his growing desire that’s an insult to his past.</p> <p>Because he’s had an entire childhood to remember why you can’t trust black witches.</p> <p>And he definitely can’t trust Kyra Farzan.</p> <p>Dark paranormal romance, enemies to lovers, found family, bodyguard, fated mates, who hurt you?</p> <p><i>Kiss of Darkness</i> is a deliciously dark paranormal romance containing explicit content, graphic violence, profanity, and topics that may be sensitive to some listeners. Full details can be found listed inside the book. Recommended for 18+.</p> <p>This novel is written in British English including spelling and grammar.</p>"; 
